select * from (select     substr(w_warehouse_name,1,20)  ,sm_type  ,web_name  ,sum(case when (ws_ship_date_sk - ws_sold_date_sk <= 30 ) then 1 else 0 end)  as "30 days"   ,sum(case when (ws_ship_date_sk - ws_sold_date_sk > 30) and                  (ws_ship_date_sk - ws_sold_date_sk <= 60) then 1 else 0 end )  as "31-60 days"   ,sum(case when (ws_ship_date_sk - ws_sold_date_sk > 60) and                  (ws_ship_date_sk - ws_sold_date_sk <= 90) then 1 else 0 end)  as "61-90 days"   ,sum(case when (ws_ship_date_sk - ws_sold_date_sk > 90) and                 (ws_ship_date_sk - ws_sold_date_sk <= 120) then 1 else 0 end)  as "91-120 days"   ,sum(case when (ws_ship_date_sk - ws_sold_date_sk  > 120) then 1 else 0 end)  as ">120 days" from   web_sales  ,warehouse  ,ship_mode  ,web_site  ,date_dimwhere    d_month_seq between 1215 and 1215 + 11and ws_ship_date_sk   = d_date_skand ws_warehouse_sk   = w_warehouse_skand ws_ship_mode_sk   = sm_ship_mode_skand ws_web_site_sk    = web_site_skgroup by   substr(w_warehouse_name,1,20)  ,sm_type  ,web_nameorder by substr(w_warehouse_name,1,20)        ,sm_type       ,web_name ) where rownum <= 100;